import React, { Component } from 'react'
import Workbook from 'react-excel-workbook'
const columns = [
    {
        columns: ["date", "เลขพัสดุ", "ราคาสินค้า", "ชื่อลูกค้า", "ที่อยู่จัดส่งพัสดุ", "รหัสไปรษณี", "เบอร์ติดต่อ"],
        data: ["2019-01-23", "820079564894", "475.01", "66950272047", "41/47 ร้านเสริมสวยปุ๊ ถ.แกรนวิล ซ.3 อ. เบตง จ.ยะลา", "77442", "0871229187"]
    }
]
class exportExcel extends Component {

    render() {
        return (
            <div>
                <Workbook filename="example.xlsx" element={<button className="">Try me!</button>}>
                    <Workbook.Sheet data={data1} name="Sheet A">
                        <Workbook.Column label="Foo" value="foo" />
                        <Workbook.Column label="Bar" value="bar" />
                    </Workbook.Sheet>
                    <Workbook.Sheet data={data2} name="Another sheet">
                        <Workbook.Column label="Double aaa" value={row => row.aaa * 2} />
                        <Workbook.Column label="Cubed ccc " value={row => Math.pow(row.ccc, 3)} />
                    </Workbook.Sheet>
                </Workbook>
            </div>
        )
    }
}

export default exportExcel
